import React from 'react';

const Footer = () => {
  return (
    <footer className='blk_red'>
      <div>
        <div className='footer_logo_venue font_righteous'>The venue</div>
        <div className='footer_logo_title'>Musical Events</div>
      </div>
    </footer>
  );
};

export default Footer;
